INSERT INTO `vars` VALUES (6,'get_product_qty','Quantità prodotto','Ritorna la quantità del prodotto','variables:get_product_qty {product_id}',NULL,'        $productId = $this->argument(\'product_id\');\n\n        $quantity = ProductAttributes::where(\'product_ref_id\', $productId)\n            ->where(\'attribute_code\', getAttributeIdByCode(\'QTY\'))\n            ->whereNull(\'attribute_date_end\')\n            ->first();\n\n        Logs::create([\n            \'log_type\' => \'LOG_EXECUTION_OF_VARIABLE:\' . $this->signature . \'_\' . $productId,\n            \'method\' => $request->method(),\n            \'uri\' => $request->url(),\n            \'message\' => $quantity->attribute_value,\n            \'user_id\' => Auth::id() ?? 0,\n            \'app_mode\' => env(\'APP_ENV\')\n        ]);\n\n        $this->info($quantity->attribute_value);\n        return self::SUCCESS;',1,NULL,'2024-02-07 16:26:58','2024-02-07 16:26:56',NULL,NULL),(7,'get_school_ref_for_product','Scuola di assegnazione del prodotto','Ritorna la scuola dove il prodotto è residente','variables:get_school_ref_for_product {product_id}',NULL,'        $productId = $this->argument(\'product_id\');\n\n        $quantity = ProductAttributes::where(\'product_ref_id\', $productId)\n            ->where(\'attribute_code\', getAttributeIdByCode(\'UNITY\'))\n            ->whereNull(\'attribute_date_end\')\n            ->first();\n\n        Logs::create([\n            \'log_type\' => \'LOG_EXECUTION_OF_VARIABLE:\' . $this->signature . \'_\' . $productId,\n            \'method\' => $request->method(),\n            \'uri\' => $request->url(),\n            \'message\' => getUnityName($quantity->attribute_value),\n            \'user_id\' => Auth::id() ?? 0,\n            \'app_mode\' => env(\'APP_ENV\')\n        ]);\n\n        $this->info(getUnityName($quantity->attribute_value));\n        return self::SUCCESS;',1,1,'2024-02-08 10:29:44','2024-02-08 10:29:45',NULL,NULL);
